/**
 * Base class for the authentications
 */
export class Authentication {
    /**
     * Set authentication data
     *
     * @param {object|string} data - Authentication data.
     */
    set authData(data) {
        this._authData = data;
    }

    /**
     * Get authentication data
     *
     * @returns {object|string}
     */
    get authData() {
        return this._authData;
    }
}

import {Jwt} from './jwt';


export var auth = {
    [Jwt.type()]: Jwt
};

import {Authentication} from './authentication';


export class Jwt extends Authentication {
    constructor() {
        super();
    }

    /**
     * Authentication type e.g. Jwt, BasicAuth
     *
     * @returns {string}
     */
    static type() {
        return 'Jwt';
    }

    /**
     * Get formatted authentication settings
     *
     * @returns {object}
     */
    getSettings() {
        return {
            headers: {
                'Authorization': `Bearer ${this.getToken()}`
            }
        };
    }

    /**
     * Set Jwt authentication token value
     *
     * @param {string} token - JWT Token value
     *
     * @example
     * ingresse.ticket.auth.setToken('12345.67890.1234');
     */
    setToken(token) {
        this.authData = token;
    }

    /**
     * Get Jwt authentication token value
     *
     * @returns {string}
     *
     * @example
     * ingresse.ticket.auth.getToken();
     */
    getToken() {
        return this.authData;
    }
}

import {apis} from './apis';
import {version} from '../package.json';


/**
 * Ingresse JavaScript SDK
 */
class IngresseSdk {
    /**
     * Instantiate the SDK
     *
     * @param {object} [settings] - SDK configuration settings
     *
     * @example
     * ```
     * var Sdk = require('ingresse-sdk');
     *
     * var ingresse = new Sdk({
     *   ticket: {
     *     url: 'http://hml.ticket.ingresse.com'
     *   }
     * });
     * ```
     */
    constructor(settings = {}) {
        this._init(settings);
    }

    /**
     * Ingresse Sdk Version
     *
     * @returns {string}
     */
    static version() {
        return version;
    }

    /**
     * Initialize API's configurations
     *
     * @param {object} settings - SDK settings.
     */
    _init(settings = {}) {
        let apiList = settings.apis || Object.keys(apis);

        apiList.map((key) => {
            let Api = apis[key];

            if (Api) {
                let options = settings[key] || null;
                this[key]   = new Api(options);
            }
        });
    }
}

module.exports = IngresseSdk
module.exports.default = IngresseSdk

